import React from "react";
import './header.css'
class Header extends React.Component {
  render() {
    return(
      <header>
        <button>
        Dashboard 
        <i className="fa-duotone fa-chart-column fa-bounce"></i>
        </button>

        <button>
        Transactions
        <i class="fa-sharp fa-regular fa-money-simple-from-bracket"></i>
        </button>


        <button>
        Income
        <i class="fa fa-inr"></i>
        </button>

       <button>
        Expenses
        <i class="fa-regular fa-money-bills"></i>
        </button>

       <img src={"hello"}></img>


      </header>
    );
  }
}
export default Header;
